function startRotatingIcon() {
  const icon = wwLib.getFrontDocument().getElementById("rotating-icon");
  if (!icon) return;

  let angle = 0;
  const speed = 6;

  function rotate() {
    angle = (angle + speed) % 360;
    icon.style.transform = `rotate(${angle}deg)`;
    requestAnimationFrame(rotate);
  }

  rotate();
}

// call immediately
startRotatingIcon();

